CREATE DEFINER=`admin`@`%` PROCEDURE `SubmitBulkResponses`(
  IN p_roll_no VARCHAR(255),
  IN p_ip_address VARCHAR(255),
  IN p_json_responses JSON
)
BEGIN
  -- âœ… All variable declarations must come first
  DECLARE v_candidate_id INT;
  DECLARE i INT DEFAULT 0;
  DECLARE total INT;
  DECLARE q_id INT;
  DECLARE o_id INT;
  DECLARE rating INT;

  -- âœ… Now safe to use SQL statements
  SELECT id INTO v_candidate_id
  FROM candidates
  WHERE roll_no = p_roll_no
  LIMIT 1;

  IF v_candidate_id IS NULL THEN
    SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'Candidate not found';
  END IF;

  -- âœ… Assign total JSON items AFTER variable declaration
  SET total = JSON_LENGTH(p_json_responses);

  WHILE i < total DO
    SET q_id = JSON_UNQUOTE(JSON_EXTRACT(p_json_responses, CONCAT('$[', i, '].question_id')));
    SET o_id = JSON_UNQUOTE(JSON_EXTRACT(p_json_responses, CONCAT('$[', i, '].option_id')));
    SET rating = JSON_UNQUOTE(JSON_EXTRACT(p_json_responses, CONCAT('$[', i, '].rating')));

    IF q_id IS NOT NULL AND o_id IS NOT NULL AND rating IS NOT NULL THEN
      INSERT INTO responses (candidate_id, question_id, option_id, rating, ip_address)
      VALUES (v_candidate_id, q_id, o_id, rating, p_ip_address)
      ON DUPLICATE KEY UPDATE
        option_id = VALUES(option_id),
        rating = VALUES(rating),
        ip_address = VALUES(ip_address);
    END IF;

    SET i = i + 1;
  END WHILE;
END ;;
DELIMITER ;
